CHAPITRE  70 Edition  1er janvier  2022  




VERRE  ET OUVRAGES  EN VERRE  

Notes.  
1.- Le présent  Chapitre  ne comprend  pas : 
a) les articles du n° 32.07 (compositions vitrifiables, frittes  de verre, autres verres sous forme de poudre, de  
grenailles,  de lamelles  ou de flocons,  par exemple);  
b) les articles  du Chapitre  71 (bijouterie  de fantaisie,  par exemple);  
c) les câbles  de fibres  optiques  du n° 85.44,  les isolateurs  (n° 85.46)  et les pièces  isolantes  du n° 85.47;  
d) les pare-brises,  vitres  arrières  et autres  glaces,  encadrés,  pour véhicules  des Chapitres  86 à 88; 
e) les pare -brises, vitres arrières et autres glaces, même encadrés, incorporant des dispositifs  chauffants ou  
autres  dispositifs  électriques  ou électroniques,  pour véhicules  des Chapitres  86 à 88; 
f) les fibres optiques, les éléments d'optique travaillés optiquement, les seringues hypoder -miques, les yeux  
artificiels,  ainsi que les thermomètres,  baromètres,  aréomètres,  densimètres  et autres  articles  et 
instruments  du Chapitre  90; 
g) les luminaires et appareils d'éclairage , lampes -réclames, enseignes lumineuses, plaques indicatrices  
lumineuses et articles similaires, possédant une source d'éclairage fixée à demeure, ainsi que leurs  
parties , du n° 94.05;  
